- Wāhi noho: Kongresni trg 13, 1000 Ljubljana, Slovenia;
- Paetukutuku: muzejiluzij.si;
- Waea: +386 1 320 54 66;
- Nga haora mahi: i nga ra katoa mai i te 09:00 ki te 22:00.
Ko nga kaitoi i whakatau ki te haere ki te whakapaipai o Slovenia , Ljubljana , ka kite i te maha o nga tikanga ahurea. Ko enei ko nga whakaaturanga tawhito e whakaatuhia ana i roto i nga whare taonga, me nga toi o ngaianei. Na, ko te Museum of Illusions te nui o te rongonui, e mohiotia ana e tona taiao taketake, i te mea k
... 
ga manuhiri e kite ana ia ratou mai i te koki tino rereke;
- ruma, kei hea te waihanga o te korenga;
- nga mea rereke me nga mea whakamataku, hei tauira, he upoko i runga i te rihi me te wairua whakaari;
- He ruma e taea ai e koe te kite i te ao i roto i te kaataika;
- Ko te ruma o te Ames, i reira ka taea e nga manuhiri te kite ia ratau i te rahi me te iti o te rahi;
- He maha nga whakaaturanga e kitea ana i roto i nga ahuatanga purotu, e whakaatuhia ana i roto i te ahua o nga waiata me nga cho
...
angata katoa te haere, ka kore he whakauru. Ko te utu putea ko te 9.5 € mo te pakeke, ko nga tamariki e 5-15 tau te haere ki te 5.5 €. Ka whakaratohia he utu mo te whanau e 2 pakeke me te 2 tamariki, ka taea te haere mo te 23.50 €. Nga Pukapuka Ingarihi, Slovenian, Italian ka awhina ki te whakahaere i te tirohanga.
Me pehea ki te haere ki reira?
Ko te Museum of Illusions kei te takiwa tonu o te Paremete Congress. Ka taea e koe te tiki mai i nga wahi katoa i roto i te whakapaipai ma te kawe waka.

Wedge GLH momo whakamatao condenser
Kōtaha Kamupene
Whakaahuatanga Hua
Āhuahira
● High-kounga maitai anga, te rehu mata, waikura-ātete, ahua ataahua;
● hua i muri i 2.5MPa tightness whakamātautau me te pūnaha parakaingaki maimoatanga;
● He nui te mahi whakawhiti wera wera, he ma me te maroke;
● Konumohe fin punching mo te "L" toronga raina o te kiriata, whakawhänui ngongo tata whakapā pai whakawhiti wera;
● he whaitake te whanui hoahoa condenser, ko te tawhiti i waenga i nga matatahi me nga konumohe he nui atu i te 1/3 te diameter o nga matatahi kia nui ai te waahi o te hau o te mahi;
● Ko nga hua motuhake, me waea atu ki te tari hokohoko a te kamupene.

Pūoko Ultrasonic Tino Tika (DYP-A21)
Ko nga ahuatanga o te waahanga DYP-A21 ko te taumira mirimita, 3cm ki te 500cm te awhe, te hanga me te maha o nga momo whakaputa: PWM pulse whanui whakaputa, UART mana whakahaere, UART whakaputa aunoa, whakaputa whakawhiti, putanga RS485, putanga ICC, putanga CAN.
Ka mau te pukoro i tetahi whare PVC kiato me te pakari, ka tutuki ki te paerewa urunga wai IP67. I tua atu, ka whakamahia e te A21 te mana oro putanga teitei, ka honoa me te whiwhinga taurangi tonu,
... 
3~24V;
• ka taea e te waahi matapo te 2.5cm te iti rawa;
•Ka taea te tautuhi i te awhe tino tawhiti, ka taea te whakatakoto i te awhe taumata 5 katoa o te 50cm ki te 500cm ma nga tohutohu;
•He maha nga momo momo whakaputa e waatea ana, UART auto / whakahaere, PWM te whakahaere, huri i te taumata TTL rōrahi (3.3V), RS485, IIC, etc. (Ka taea e te UART te whakahaere me te PWM te kohi hiko te tautoko i te whakapau kaha mo te moe tino iti≤5uA);
•Ko te 115,200 te utu taunoa, Ka tautoko te whakarereket
...
toa e tautokohia ana mo nga ahuatanga tono rereke;
•Ko te mahi whakaheke haruru kua hangaia hei tautoko i te taumata whakaheke haruru 5-akomanga;
•Te hangarau tukatuka ngaru acoustic atamai, hanga-i roto i te algorithm atamai ki te tātari ngaru oro pokanoa, ka taea te tautuhi i nga ngaru oro pokanoa me te mahi aunoa;
•Hoahoa hanganga parewai, parewai tohu IP67;
•He kaha te urutau ki te whakaurunga, he ngawari te tikanga whakauru, he pumau, he pono;
• Tautokohia te whakamohoatanga firmware mamao;
